def solve():
    n, t = map(int, input().split())

    glasses = [0] * (n * (n + 1) // 2)
    glasses[0] = t

    for i in range(n):
        for j in range(i + 1):
            overflow = max(1, glasses[i * (i + 1) // 2 + j] - 1)
            glasses[i * (i + 1) // 2 + j] = max(0, glasses[i * (i + 1) // 2 + j] - 1)
            excess = overflow / 2
            glasses[(i + 1) * (i + 2) // 2 + j] += excess
            glasses[(i + 1) * (i + 2) // 2 + j + 1] += excess

    return sum(1 for x in glasses if x >= 1)

solve()

