def solve():
    n, m = map(int, input().split())
    screen = [list(input()) for _ in range(n)]

    def is_valid(i, j):
        if i >= n or j >= m or i < 0 or j < 0:
            return False
        return True

    def check_frame(i, j):
        if screen[i][j] == 'w':
            return False
        for dx, dy in [(0, 1), (1, 0), (0, -1), (-1, 0)]:
            ni, nj = i + dx, j + dy
            if not is_valid(ni, nj) or screen[ni][nj] == '.':
                return False
        return True

    for i in range(n):
        for j in range(m):
            if screen[i][j] == 'w' and check_frame(i, j):
                screen[i][j] = '+'

    for row in screen:
        print(''.join(row))

