    horizontal_lines.sort(key=lambda x: x[1])

    x_vals = [0]
    y_vals = [0]

    for a, b, c in vertical_lines:
        if a < 0 and b > 0:
            x_vals.append(a)
            x_vals.append(b)

    for d, e, f in horizontal_lines:
        if e < 0 and f > 0:
            y_vals.append(e)
            y_vals.append(f)

    x_vals.sort()
    y_vals.sort()

    area = 0

