        graph = {i: [] for i in range(1, n+1)}
        for u, v in edges:
            graph[u].append(v)

        def has_cycle(node, visited, stack):
            visited[node] = True
            stack[node] = True

            for neighbor in graph[node]:
                if not visited[neighbor]:
                    if has_cycle(neighbor, visited, stack):
                        return True
                elif stack[neighbor]:
