def solve(n: int) -> int:
    mod = 998244353

    def calculate(num):
        curr = 1
        for i in range(1, num+1):
            curr = (curr * i) % mod
        return curr

    def count_trees(k):
        ans = 0
        for i in range(k, n+1, 2):
            left = i - k
            right = n - i
            ans = (ans + (calculate(n-1) * pow((calculate(left) * calculate(right)) % mod, mod-2, mod)) % mod
        return ans

    if n % 2 == 0:
        return count_trees(n//2)
    else:
        return 0

solve()

