def solve():
    import itertools
    s = input()
    t = input()

    def restore_number(s, t):
        n = len(s) - len(t)
        for perm in itertools.permutations(t):
            match = ''.join(perm)
            if n == 0:
                if match <= s:
                    return match
            else:
                if match < s:
                    return '1' + '0' * n + match
        return '1' + '0' * n + ''.join(t)

    result = restore_number(s, t)
    return result


solve()

