from collections import Counter

def solve(n):
    def factors(x):
        d = 2
        while d * d <= x:
            if x % d == 0:
                yield d
                x //= d
            else:
                d += 1
        if x > 1:
            yield x

    factor_counts = Counter(factors(n))
    weights = set()

    for count in factor_counts.values():
        for i in range(1, count + 1):
            weights.add(i)

    return len(weights)

solve()

