from math import sqrt

def solve(n):
    def count_factors(num):
        count = 0
        for i in range(1, int(sqrt(num)) + 1):
            if num % i == 0:
                if num // i == i:
                    count += 1
                else:
                    count += 2
        return count

    return count_factors(n)

# Example usages
