import math

def solve():
    n = int(input())

    def factors(num):
        factors_list = []
        for i in range(1, int(math.sqrt(num)) + 1):
            if num % i == 0:
                factors_list.append(i)
                factors_list.append(num // i)
        return sorted(list(set(factors_list)))

    min_value = n
    min_operations = 0

    for factor in factors(n):
        temp = n
        operations = 0
        while temp % factor == 0:
            temp //= factor
            operations += 1
        operations += temp - 1
        if (min_value == n) or (operations + 1 < min_operations):
            min_value = factor
            min_operations = operations + 1

    print(min_value, min_operations)

