    n = len(s)
    cnt = Counter(s)
    odd_char = ''
    for char, freq in cnt.items():
        if freq % 2 != 0:
            if odd_char:
                return "NO SOLUTION"
            odd_char = char
    if odd_char:
        cnt[odd_char] -= 1
    left, right = [], []
    for char, freq in cnt.items():
        for _ in range(freq // 2):
            left.append(char)
            right.insert(0, char)
    if odd_char:
        left.append(odd_char)
    return ''.join(left + right)

