def solve(s: str) -> str:
    from collections import Counter

    counter = Counter(s)
    odd_chars = [char for char, count in counter.items() if count % 2 != 0]

    palindrome = []
    for char, count in counter.items():
        palindrome.extend([char]*(count//2))

    half_length = len(palindrome)
    if len(odd_chars) > 1:
        palindrome.insert(half_length, odd_chars[0])

    palindrome.sort()

    second_half = palindrome[::-1]
    if len(odd_chars) == 1:
        palindrome.insert(half_length, odd_chars[0])

    return ''.join(palindrome + second_half)

solve()

