def solve():
    import collections
    s = input().strip()

    freq = collections.Counter(s)

    left, right = 0, len(s) - 1
    result = list(s)

    for char, count in freq.items():
        while count >= 2:
            result[left] = char
            result[right] = char
            left += 1
            right -= 1
            count -= 2

    for char, count in freq.items():
        if count == 1:
            result[left] = char
            break

    return ''.join(result)

solve()

