def solve():
    import heapq

    N, M = map(int, input().split())
    S = list(map(int, input().strip()))

    distances = [-1] * (N + 1)
    distances[0] = 0
    heap = [(0, [1])]

    while heap:
        dist, seq = heapq.heappop(heap)
        if len(seq) > N + 1:
            continue
        if seq[-1] == N:
            return " ".join(map(str, seq[1:]))

        for i in range(1, M + 1):
            next_pos = min(seq[-1] + i, N)
            if S[next_pos] == 1:
                continue
            if distances[next_pos] == -1 or distances[next_pos] > dist + 1:
                distances[next_pos] = dist + 1
                heapq.heappush(heap, (dist + 1, seq + [next_pos]))

    return -1

solve()

