def solve():
    N, X, D = map(int, input().split())
    MOD = 10**9 + 7

    def gcd(a, b):
        while b:
            a, b = b, a % b
        return a

    def lcm(a, b):
        return a * b // gcd(a, b)

    if D == 0:
        if X == 0:
            return 1
        else:
            return N + 1

    X = (X % D + D) % D
    X_inv = pow(X, MOD - 2, MOD)
    D_inv = pow(D, MOD - 2, MOD)

    ans = 0
    dp = {}
    for k in range(N + 1):
        a = k * (k - 1) // 2
        b = (N - 1) * k
        c = N * (N - 1) // 2
        L = lcm(b, c)
        if L not in dp:
            dp[L] = pow(X_inv, a, MOD) * pow(D_inv, k, MOD) % MOD
        ans += dp[L]
        ans %= MOD

    return ans

solve()

