from math import gcd

def solve(N, X, D):
    def euclid(a, b):
        while b:
            a, b = b, a % b
        return a

    if D == 0:
        return 1 if X == 0 else N+1

    X = (X % D + D) % D

    memo = {}
    q, r = divmod(X, D)
    memo[r] = {0: 1, 1: 1-q, -1: q+1}

    def solve_inner(n, r):
        if r in memo and n in memo[r]:
            return memo[r][n]
        q, s = divmod(n, r)
        ret = solve_inner(r, s) * q + solve_inner(s, r)
        if n >= r:
            ret += solve_inner(n-r, r)
        if r >= s:
            ret += solve_inner(n, r-s)
        memo[r][n] = ret
        return ret

    return sum(solve_inner(N, i) for i in range(min(N, D)))

solve()

