def solve(X2: int) -> int:
    def is_prime(num):
        if num < 2:
            return False
        for i in range(2, int(num ** 0.5) + 1):
            if num % i == 0:
                return False
        return True

    def smallest_possible_starting_number(X2):
        if X2 == 4:
            return 3
        for X0 in range(X2 - 1, 1, -1):
            if is_prime(X0):
                continue
            divisors = [i for i in range(2, X0) if X0 % i == 0]
            for prime in divisors:
                new_X = X0 + (prime - (X0 % prime))
                i = 0
                while new_X < X2:
                    if i % 2 == 0:
                        new_X += (prime - (new_X % prime))
                    else:
                        new_X += (prime + 1 - (new_X % (prime + 1)))
                    i += 1
                if new_X == X2:
                    return X0
        return X2 - 1

    return smallest_possible_starting_number(X2)

solve()

