from math import factorial

def solve():
    n, k = map(int, input().split())

    MOD = 1000000007

    def binom(n, k):
        return factorial(n) // (factorial(k) * factorial(n - k))

    def dp(n, k):
        if k == 0:
            return 1 if n == 1 else 0
        return binom(n-1, k) * dp(n-1, k-1) % MOD + binom(n-1, k-1) * dp(n-1, k) % MOD

    result = dp(n, k) % MOD
    print(result)

solve()

