        print("NO")
        return

    matrix = [[0]*n for _ in range(n)]

    # Create adjacency matrix for graph with a components
    for i in range(a):
        for j in range(i * (n // a), (i + 1) * (n // a)):
            for k in range(j + 1, (i + 1) * (n // a)):
                matrix[j][k] = 1
                matrix[k][j] = 1

    # Create adjacency matrix for complement of the graph
    for i in range(a, a + b):
        for j in range(i * (n // b), (i + 1) * (n // b)):
            for k in range(j + 1, (i + 1) * (n // b)):
                matrix[j][k] = 1
                matrix[k][j] = 1

    print("YES")
    for row in matrix:
        print("".join(map(str, row)))


