import numpy as np

def solve(n, a, b):
    if a + b > n:
        print("NO")
    else:
        graph = np.zeros((n, n))
        for i in range(a-1):
            graph[i][i+1] = 1
            graph[i+1][i] = 1
        for i in range(n-(b-1), n):
            graph[i][i-1] = 1
            graph[i-1][i] = 1

        print("YES")
        for row in graph:
            print(''.join(map(str, row)))

