import math

def solve():
    def clockwise_rotation(start, end):
        if start == '^' and end == '>':
            return True
        if start == '>' and end == 'v':
            return True
        if start == 'v' and end == '<':
            return True
        if start == '<' and end == '^':
            return True
        return False

    def solve_direction(start_pos, end_pos, n):
        clockwise = min(clockwise_rotation(start_pos, end_pos), clockwise_rotation(end_pos, start_pos))
        clockwise_turns = n % 4
        if clockwise:
            return 'cw' if clockwise_turns % 2 == 0 else 'ccw'
        return 'undefined'

    positions = input().split()
    start_pos, end_pos = positions[0], positions[1]
    n = int(input())
    print(solve_direction(start_pos, end_pos, n))

solve()

