def solve(n, m, leaders):
    current_leader = leaders[0]
    permutation = [0] * n
    permutation[current_leader - 1] = current_leader

    for i in range(1, m):
        steps = leaders[i]
        idx = 1
        while steps > 0:
            if permutation[idx % n] == 0:
                steps -= 1
            idx += 1
        if permutation[idx % n] != 0 or (idx % n) == current_leader - 1:
            return -1
        permutation[idx % n] = leaders[i]

    for i in range(n):
        if permutation[i] == 0:
            return -1

    return permutation

solve()

