def solve():
    # Required imports
    import sys

    # Function to check if a tree can be positioned on the plane
    def check_position(n, edges):
        if n == 1:
            return True
        if n == 2:
            return False

        for i in range(n - 1):
            if len(edges[i]) > 2:
                return False
        return True

    # Main code to solve the problem
    n = int(input())
    edges = [[] for _ in range(n - 1)]
    for i in range(n - 1):
        u, v = map(int, input().split())
        edges[u - 1].append(v)
        edges[v - 1].append(u)

    if not check_position(n, edges):
        print("NO")
    else:
        print("YES")
        print("0 0")
        x, y = 1, 0
        for i in range(1, n):
            print(f"{x} {y}")
            x, y = y, -x

    sys.stdout.flush()

solve()
